  <body>
    <style>
	
		html {
            -webkit-print-color-adjust: exact;
        }

		body{
			font-family: Roboto, sans-serif;
			margin: 0;
			margin-top: -18px;
		}

		.background-image {
			width: 321px;
			height: 208px;
			overflow: hidden;
			position: relative;
			background-color: #0e2e50;
			z-index: 1;
		}
	
		img {
			pointer-events: none;
			position: absolute;
			width: 100%;
			height: 100%;
			z-index: -1;
		}
	
		.content {
			display: inline-flex;
		}

		.fullName-container {
			width: 160px;
			padding-left: 19px;
			color: 	#FFFFFF;
			font-weight: bold;
			display: flex;
			align-items: center;
			padding-top: 95px;
		}

		.fullName {
			display: flex;
			flex-wrap: wrap;
			width: 180px;
			height: 34px;
			align-content: center;
			font-size: 12px;
			color: 	#FFFFFF;
		}
			
		.qrCode {
			padding-top: 73px;
			padding-left: 34px;
		}
			
		.birth-uan-container {
			display: inline-flex;
			color: #FFFFFF;
			width: -webkit-fill-available;
			margin-top: 18px;
		}
			
		.birthDate-container {
			font-size: 8px;
			padding-left: 18px;
			width: 150px;
		}
			
		.uan {
			font-weight: bold;
			font-size: 9px;
			padding-left: 50px;
		}

    </style>
